#include <iostream>
#include <vector>
#include <math.h>
using namespace std;



class Solution {
public:
int largestRectangleArea(vector<int>& heights) {
        return large_rec(heights,0,heights.size()-1);
}

int large_rec(vector<int>& heights,int start,int end){
        if(start > end)
                return 0;
        if(start==end)
                return heights[start];

        int min = heights[start];
        int min_index = start;
        for(int i=start+1; i<=end; i++) {
                if(heights[i]<min) {
                        min = heights[i];
                        min_index = i;
                }
        }

        int max_rectan = min*(end-start+1);

        int left_end = min_index-1, right_start = min_index+1;
        while (heights[left_end]==heights[min_index]) {
                left_end--;
        }
        while (heights[right_start]==heights[min_index]) {
                right_start++;
        }

        int left = large_rec(heights,start,left_end);
        int right = large_rec(heights,right_start,end);

        return max(max(max_rectan,left),right);
}
};






